import PropTypes from 'prop-types';

export function Filter({ value, onChange }) {
  return (
    <>
      <h1 className="contactTitle">Contacts</h1>
      <label htmlFor="">
        Find contacts by Name
        <input
          type="text"
          name="filter"
          value={value}
          className="username"
          omChange={onChange}
        />
      </label>
    </>
  );
}
Filter.propTypes = {
  value: PropTypes.string.isRequired,
  onChange: PropTypes.func.isRequired,
};
